import React from "react";
// Import Component MUI
import {
  Box,
  Container,
  Card,
  CardContent,
  CardMedia,
  Grid,
  Typography,
  // Button,
  IconButton,
  InputBase,
} from "@mui/material";
import { CardActionArea } from "@mui/material";
import { styled } from "@mui/material/styles";

// Import Icon
import ChevronLeftRoundedIcon from "@mui/icons-material/ChevronLeftRounded";
import SearchIcon from "@mui/icons-material/Search";
import "boxicons";

// Import Image
import image from "../images/noimage.jpg";

const Search = styled("div")(({ theme }) => ({
  position: "relative",
  borderRadius: theme.shape.borderRadius,
  border: "#0000008A solid",
  marginRight: theme.spacing(2),
  marginLeft: 0,
  width: "100%",
  [theme.breakpoints.up("sm")]: {
    marginLeft: theme.spacing(3),
    width: "auto",
  },
}));

// Icon Costum
const SearchIconWrapper = styled("div")(({ theme }) => ({
  color: "#0000008A",
  padding: theme.spacing(0, 1),
  height: "100%",
  position: "absolute",
  pointerEvents: "none",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
}));

// Input Base Costum
const StyledInputBase = styled(InputBase)(({ theme }) => ({
  // Color Search
  color: "#000",
  "& .MuiInputBase-input": {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(2.5)})`,
    width: "100%",
    [theme.breakpoints.up("md")]: {
      width: "20ch",
    },
  },
}));

export default function ListSeritifikat() {
  return (
    <div>
      <Container>
        <Box>
          <Grid>
            <Grid item xs={12}>
              <IconButton sx={{ color: "#000" }}>
                <ChevronLeftRoundedIcon sx={{ fontSize: 50 }} />
                <Typography sx={{ fontSize: 25, fontWeight: "bold" }}>
                  Sertifikat
                </Typography>
              </IconButton>
            </Grid>
          </Grid>
          <Grid container direction="row">
            <Grid item xs={11} mr={-2}>
              <Search>
                <SearchIconWrapper>
                  <SearchIcon />
                </SearchIconWrapper>
                <StyledInputBase
                  placeholder="Search"
                  inputProps={{ "aria-label": "search" }}
                />
              </Search>
            </Grid>

            <Grid item xs={1} color="#0000008A">
              <IconButton>
                <box-icon name="slider-alt" size="md" />
              </IconButton>
            </Grid>
          </Grid>

          <Grid
            container
            direction="column"
            justifyContent="center"
            alignItems="center"
          >
            <Grid item xs={12}>
              <Card sx={{ maxWidth: 495, ml: 1, mt: 2, height: 300 }}>
                <CardActionArea>
                  <CardMedia
                    component="img"
                    height="200"
                    image={images}
                    alt="green iguana"
                  />
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                      Lizard
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Lizards are a widespread group of squamate reptiles, with
                      over 6,000 species, ranging across all continents except
                      Antarctica
                    </Typography>
                  </CardContent>
                </CardActionArea>
              </Card>
            </Grid>
          </Grid>
        </Box>
      </Container>
    </div>
  );
}
